import Expenses from './Components/Expenses';

function App() {
    let expenses= [ //making of arrays
        {
            id: 'e1',
            title: 'Buy Books',
            amount: '300',
            date: new Date(2022, 5, 12)
        },
        {
            id: 'e2',
            title: 'Resturent',
            amount: '800',
            date: new Date(2022, 5, 12)
        },
        {
            id: 'e3',
            title: 'New House',
            amount: '1 lakh',
            date: new Date(2022, 5, 12)
        },
        {
            id: 'e4' ,
            title: 'University Fee',
            amount: '90,000',
            date: new Date(2022, 5, 12)
        },
        {
            id: 'e5',
            title: 'Bus Fee',
            amount: '30,000',
            date: new Date(2022, 5, 12)
        },

    ];
    return (
        <div>
          <Expenses item = {expenses}/>  
        </div>


    );
}

export default App;
